@prefix sh: <http://www.w3.org/ns/shacl#> .
@prefix : <http://e.com/> .

:shapeGGGG a sh:NodeShape ;
  sh:and (
	[ sh:path [ sh:zeroOrMorePath rdfs:subClassOf ] ;
